import React from 'react'

const RecipeList = (props) =>{
    console.log('props in Recipe list ->', props)

    const recipeList = props.recipes.map((recipe,index) =>{

        return (
            <div key={index}>
                hello
                <span>{recipe.title}</span>
                <img src={recipe.image}/>

            </div>

        )

    })

    return(
        <div>
            Hello
            {recipeList}
        </div>
    )
}

export default RecipeList
